import React from "react";
import { useParams } from "react-router-dom";

function ProfilePage({ getUser }) {
  const { email } = useParams();
  const user = getUser.find(({ em }) => em === email);
  console.log(user);
  return (
    <div>
      <img src={user.picture} alt="" />
    </div>
  );
}

export default ProfilePage;
